import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { JpgFilesComponent } from './jpg-files/jpg-files.component';
import { NoJpgFilesComponent } from './no-jpg-files/no-jpg-files.component';
import { SomeJpgFilesComponent } from './some-jpg-files/some-jpg-files.component';
import { HomeComponent } from './home/home.component';

const routes: Routes = [

   {path:"",component:HomeComponent},

   {path:"NoJpgFiles",component:NoJpgFilesComponent},

   {path:"JpgFiles",component:JpgFilesComponent},

   {path:"SomeJpgFiles",component:SomeJpgFilesComponent},

  ];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
